import React from "react"; 

import Card from '@mui/material/Card';

import CardContent from '@mui/material/CardContent';

import Typography from '@mui/material/Typography';
import TripInfoItem from "./TripInfoItem";


const TripInfoCard = () =>{

    return <>
     <Card >
      <CardContent>
          <Typography  color="text.secondary"  variant={'h5'}gutterBottom>
            informacoes da viagem 
          </Typography>
         <TripInfoItem infoTitle={'Nome'} info={'Viagem para lua'}/>
         <TripInfoItem infoTitle={'Planeta'} info={'marte'}/>
         <TripInfoItem infoTitle={'Data'} info={'20/08/2021'}/>
         <TripInfoItem infoTitle={'Descrição'} info={'ousadia e alegria'}/>
         <TripInfoItem infoTitle={'Duracao em dias'} info={228}/>
      </CardContent>
      
    </Card>
</>
} 
export default TripInfoCard
